import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import App from './App';
import Home from './pages/Home';
import About from './pages/About';
import Tabung from './pages/about/Tabung';
import Nasabah from './pages/about/Nasabah';
import ListMataUang from './pages/about/uang/ListMataUang';
import DetailMataUang from './pages/about/uang/DetailMataUang';
import Handeling from './pages/Handeling';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
    <Routes>
        <Route path = "/" element={<App />}>
          <Route index element={<Home />} />
          <Route path="about" element={<About />} >
          <Route path='tabung' element={<Tabung />} />
          <Route path='nasabah' element={<Nasabah />} />
          <Route path='list-mata-uang' element={<ListMataUang />} />
          <Route path='detail-mata-uang' element={<DetailMataUang />} />
          <Route path='input-nasabah' element={<Handeling />} />
          </Route>
          </Route>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
